INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 1, "サツキ", "おう\n好きなもん持ってきな", 9, 2, "2025/09/22 14:59:59", 0.0, 135902, 2, 10034, -470.0, "2025/06/16 15:00:00", 2002);
